<html>
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=0.3, maximum-scale=3.0, user-scalable=yes">
    <title>NYQP 2025 - Mobile Tracking</title>
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"/>
    <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
    <style>
        body { margin: 0; padding: 0; font-family: Arial, sans-serif; }
        #map { position: absolute; top: 0; bottom: 120px; left: 0; right: 0; background: white; }
        #controls { position: absolute; bottom: 0; left: 0; right: 0; height: 120px; background: #2c3e50; color: white; padding: 15px; z-index: 1000; }
        #timeline { width: 100%; margin-bottom: 10px; }
        .control-btn { background: #3498db; border: none; color: white; padding: 16px 28px; margin: 0 6px; cursor: pointer; border-radius: 5px; font-size: 18px; font-weight: bold; }
        .control-btn:hover { background: #2980b9; }
        .control-btn:disabled { background: #7f8c8d; cursor: not-allowed; }
        .control-btn.active { background: #27ae60; }
        #play-pause-btn { padding: 16px 20px; min-width: 120px; }
        #time-display { font-size: 24px; font-weight: bold; margin-bottom: 10px; }
        .mobile-marker { font-size: 32px; text-shadow: 2px 2px 4px rgba(0,0,0,0.8); }
        
        @media (max-width: 768px) {
            .control-btn { padding: 14px 20px; margin: 3px; font-size: 16px; }
            #county-filter, #speed-select { padding: 10px; font-size: 15px; }
        }
        
        .leaflet-popup-content { font-size: 16px !important; min-width: 250px !important; }
        .leaflet-popup-content-wrapper { padding: 15px !important; }
    </style>
</head>
<body>
    <div id="loading">Loading contest data...</div>
    <div id="map"></div>
    <div id="controls" style="display:none;">

            </div>
            <div>
                <button id="play-pause-btn" class="control-btn">▶ Play</button>
                <button id="reset-btn" class="control-btn">↺ Reset</button>
                <span style="margin-left: 15px;">Speed:</span>
                <select id="speed-select" onchange="setSpeed(parseInt(this.value))" style="padding: 8px; font-size: 14px; border-radius: 5px; border: none; margin-right: 15px;">
                    <option value="100">100x</option>
                    <option value="500">500x</option>
                    <option value="1000" selected>1000x</option>
                    <option value="2000">2000x</option>
                </select>
                <span>Show:</span>
                <select id="county-filter" onchange="filterMobiles()" style="padding: 8px; font-size: 14px; border-radius: 5px; border: none;">
                    <option value="0">ALL</option>
                    <option value="5">5+ Counties</option>
                    <option value="10">10+ Counties</option>
                </select>
            </div>
        </div>
        <input type="range" id="timeline" min="0" max="100" value="0" step="0.1">
    </div>

            'Hamilton':'HAM','Herkimer':'HER','Jefferson':'JEF','Kings':'KIN','Lewis':'LEW',

            'New York':'NEW','Niagara':'NIA','Oneida':'ONE','Onondaga':'ONO','Ontario':'ONT',
            'Orange':'ORA','Orleans':'ORL','Oswego':'OSW','Otsego':'OTS','Putnam':'PUT',

            'Tioga':'TIO','Tompkins':'TOM','Ulster':'ULS','Warren':'WAR','Washington':'WAS',
            'Wayne':'WAY','Westchester':'WES','Wyoming':'WYO','Yates':'YAT'
        };

        let countyLayers = {};
        let countyCounts = {};
        let mobileMarkers = {};
        let currentIndex = 0;
        let isPlaying = false;
        let animationSpeed = 1000;
        let animationInterval;
        let timelineData = timelineDataRaw.map(item => ({timestamp: item[0], county: item[1]}));

        document.getElementById('loading').style.display = 'none';
        document.getElementById('controls').style.display = 'block';
        initMap();

        function initMap() {
            const nyOutline = L.geoJSON(boundaries);
            const bounds = nyOutline.getBounds();
            const padding = window.innerWidth <= 768 ? [10, 10] : [20, 20]; // Less padding on mobile = more zoomed in
            map.fitBounds(bounds, {padding: padding});
            map.setMaxBounds(bounds.pad(0.2));

            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);

            L.rectangle([[-90, -180], [90, 180]], {
                color: 'white', fillColor: 'white', fillOpacity: 1, weight: 0, interactive: false
            }).addTo(map);

            const nyLayer = L.geoJSON(boundaries, {
                style: () => ({fillColor: '#e8e8e8', weight: 2, color: '#666', fillOpacity: 0.6}),
                onEachFeature: (f, layer) => {
                    const c = nameMap[f.properties.NAME];
                    countyLayers[c] = layer;
                    countyCounts[c] = 0;
                }
            }).addTo(map);
            nyLayer.bringToFront();

            const mobileConfig = {
                'AB1BL': {icon: '🚙', color: 'red', darkColor: 'darkred'},
                'K2A': {icon: '🚐', color: 'blue', darkColor: 'darkblue'},
                'K2G': {icon: '🛻', color: 'green', darkColor: 'darkgreen'},
                'K2Q': {icon: '🚗', color: 'orange', darkColor: 'darkorange'},
                'K2V': {icon: '🚕', color: 'yellow', darkColor: 'goldenrod'},
                'KQ2R': {icon: '🚌', color: 'purple', darkColor: 'indigo'},
                'KV2X/M': {icon: '🚎', color: 'brown', darkColor: 'saddlebrown'},
                'N1GBE': {icon: '🚓', color: 'cyan', darkColor: 'darkcyan'},
                'N2B': {icon: '🚑', color: 'pink', darkColor: 'deeppink'},
                'N2CU': {icon: '🚒', color: 'darkred', darkColor: 'maroon'},
                'N2T': {icon: '🚚', color: 'gray', darkColor: 'dimgray'},
                'W1WV/M': {icon: '🚛', color: 'darkblue', darkColor: 'navy'},
                'WI2M': {icon: '🚜', color: 'darkgreen', darkColor: 'forestgreen'},
                'WT2X': {icon: '🏎️', color: 'black', darkColor: 'black'}
            };

            Object.keys(mobileConfig).forEach(call => {
                if (mobileTracks[call] && mobileTracks[call].length > 0) {
                    const firstCounty = mobileTracks[call][0].county;
                    let coords;
                    
                    if (firstCounty.includes('/')) {
                        const counties = firstCounty.split('/');
                        const c1 = countyCoords[counties[0]];
                        const c2 = countyCoords[counties[1]];
                        if (c1 && c2) {
                            coords = [(c1[0] + c2[0]) / 2, (c1[1] + c2[1]) / 2];
                        }
                    } else {
                        coords = countyCoords[firstCounty];
                    }
                    
                    if (coords) {
                        const marker = L.marker([coords[0], coords[1]], {
                            icon: L.divIcon({
                                html: `<div class="mobile-marker">${mobileConfig[call].icon}</div><div style="text-align:center; font-size:10px; font-weight:bold; color:black; text-shadow: 1px 1px 2px white;">${call.replace('/M', '')}</div>`,
                                className: '',
                                iconSize: [40, 40]
                            }),
                            zIndexOffset: 1000
                        }).addTo(map);
                        mobileMarkers[call] = {marker: marker, trackIndex: 0};
                    }
                }
            });

            document.getElementById('timeline').max = timelineData.length - 1;
            document.getElementById('qso-counter').textContent = `QSOs: 0 / ${timelineData.length}`;
        }

        function getColor(count, max) {
            if (!count) return '#e8e8e8';
            const r = count / max;
            if (r > 0.8) return '#8b0000';
            if (r > 0.6) return '#d73027';
            if (r > 0.4) return '#fc8d59';
            if (r > 0.2) return '#fee08b';
            if (r > 0.05) return '#ffffbf';
            return '#e0f3f8';
        }

        function updateMobiles(timestamp) {
            Object.keys(mobileMarkers).forEach(call => {
                const track = mobileTracks[call];
                const mobile = mobileMarkers[call];
                
                for (let i = mobile.trackIndex; i < track.length; i++) {
                    if (track[i].timestamp <= timestamp) {
                        const county = track[i].county;
                        let coords;
                        
                        if (county.includes('/')) {
                            const counties = county.split('/');
                            const c1 = countyCoords[counties[0]];
                            const c2 = countyCoords[counties[1]];
                            if (c1 && c2) {
                                coords = [(c1[0] + c2[0]) / 2, (c1[1] + c2[1]) / 2];
                            }
                        } else {
                            coords = countyCoords[county];
                        }
                        
                        if (coords) {
                            mobile.marker.setLatLng([coords[0], coords[1]]);
                            mobile.trackIndex = i;
                        }
                    } else {
                        break;
                    }
                }
            });
        }

        function updateMap(index) {
            if (index >= timelineData.length) return;
            
            const qso = timelineData[index];
            const county = qso.county;
            
            if (countyLayers[county]) {
                countyCounts[county]++;
                const maxCount = Math.max(...Object.values(countyCounts));
                countyLayers[county].setStyle({
                    fillColor: getColor(countyCounts[county], maxCount),
                    fillOpacity: 0.8
                });
            }
            
            updateMobiles(qso.timestamp);
            
            const [date, time] = qso.timestamp.split(' ');
            const [year, month, day] = date.split('-');
            const monthNames = ['JAN','FEB','MAR','APR','MAY','JUN','JUL','AUG','SEP','OCT','NOV','DEC'];
            document.getElementById('time-display').textContent = `${day} ${monthNames[parseInt(month)-1]} ${year} ${time} Z`;
            document.getElementById('qso-counter').textContent = `QSOs: ${index + 1} / ${timelineData.length}`;
            document.getElementById('timeline').value = index;
            currentIndex = index;
        }

        function play() {
            if (isPlaying || !timelineData) return;
            if (currentIndex >= timelineData.length - 1) {
                reset();
            }
            isPlaying = true;
            document.getElementById('play-pause-btn').innerHTML = '|| Pause';

            const qsosPerTick = Math.max(1, Math.floor(animationSpeed / 100));
            
            animationInterval = setInterval(() => {
                for (let i = 0; i < qsosPerTick; i++) {
                    if (currentIndex >= timelineData.length - 1) {
                        pause();
                        return;
                    }
                    updateMap(currentIndex + 1);
                }
            }, 10);
        }

        function pause() {
            isPlaying = false;
            document.getElementById('play-pause-btn').innerHTML = '▶ Play';
            clearInterval(animationInterval);
        }

        function reset() {
            pause();
            currentIndex = 0;
            
            Object.keys(countyCounts).forEach(county => {
                countyCounts[county] = 0;
                if (countyLayers[county]) {
                    countyLayers[county].setStyle({fillColor: '#e8e8e8', fillOpacity: 0.6});
                }
            });

            Object.keys(mobileMarkers).forEach(call => {
                mobileMarkers[call].trackIndex = 0;
                const firstCounty = mobileTracks[call][0].county;
                let coords;
                
                if (firstCounty.includes('/')) {
                    const counties = firstCounty.split('/');
                    const c1 = countyCoords[counties[0]];
                    const c2 = countyCoords[counties[1]];
                    if (c1 && c2) {
                        coords = [(c1[0] + c2[0]) / 2, (c1[1] + c2[1]) / 2];
                    }
                } else {
                    coords = countyCoords[firstCounty];
                }
                
                if (coords) {
                    mobileMarkers[call].marker.setLatLng([coords[0], coords[1]]);
                }
            });

            document.getElementById('time-display').textContent = 'NYQP 2025';
            document.getElementById('qso-counter').textContent = 'QSOs: 0 / ' + timelineData.length;
            document.getElementById('timeline').value = 0;
        }

        function filterMobiles() {
            const minCounties = parseInt(document.getElementById('county-filter').value);
            Object.keys(mobileMarkers).forEach(call => {
                const countySet = new Set();
                mobileTracks[call].forEach(entry => {
                    if (entry.county.includes('/')) {
                        entry.county.split('/').forEach(c => countySet.add(c));
                    } else {
                        countySet.add(entry.county);
                    }
                });
                const countyCount = countySet.size;
                if (countyCount >= minCounties) {
                    mobileMarkers[call].marker.addTo(map);
                } else {
                    mobileMarkers[call].marker.remove();
                }
            });
        }

        function setSpeed(speed) {
            animationSpeed = speed;
            if (isPlaying) {
                pause();
                play();
            }
        }

        document.getElementById('play-pause-btn').addEventListener('click', () => {
            if (isPlaying) pause();
            else play();
        });
        document.getElementById('reset-btn').addEventListener('click', reset);
    </script>
